import * as React from 'react';
import TextField from '@mui/material/TextField';
import './Home.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <TextField id="outlined-basic" label="Name" variant="outlined" defaultValue="Enter name..."/>
        <TextField id="outlined-basic" label="Room Code" variant="outlined" defaultValue="Enter Room Code..."/>
      </header>
    </div>
  );
}

export default App;
